import React, { useState, useEffect } from 'react';
import axios from 'axios';
// import Header from '../components/Header';
import Footer from '../components/Footer';
import './Privacy.css';

function Privacy() {
  const [policy, setPolicy] = useState([]);
  const [error, setError] = useState('');
  const [activeSection, setActiveSection] = useState(null);
  const [selectedCsv, setSelectedCsv] = useState(null);
  const [csvData, setCsvData] = useState(null);
  const [csvError, setCsvError] = useState('');

  useEffect(() => {
    window.scrollTo(0, 0);
    const fetchPolicy = async () => {
      try {
        const response = await axios.get('http://localhost:5001/api/privacy');
        setPolicy(response.data);
      } catch (err) {
        setError('Failed to load policy.');
        setPolicy([
          { section: 'Privacy Collection', content: 'We collect personal information such as email addresses and preferences to enhance your experience.' },
          { section: 'Data Collection', content: 'We collect data from movies.csv and credits.csv to analyze movie trends and user ratings.' },
          { section: 'Data Usage', content: 'Collected data is used for personalization, recommendations, and improving our services.' },
        ]);
      }
    };
    fetchPolicy();
  }, []);

  const fetchCsvData = async (filename) => {
    setCsvError('');
    setCsvData(null);
    try {
      const response = await axios.get(`http://localhost:5001/api/csv/${filename}`);
      const text = response.data;
      // Parse CSV text into rows and columns
      const rows = text.trim().split('\n').map(row => row.split(',').map(cell => cell.trim()));
      const headers = rows[0];
      const data = rows.slice(1);
      setCsvData({ headers, data });
    } catch (err) {
      setCsvError(`Failed to load ${filename}.`);
      // Fallback CSV data
      const fallbackData = filename === 'movies.csv'
        ? {
            headers: ['movieId', 'title', 'genres'],
            data: [
              ['1', 'Toy Story (1995)', 'Animation|Adventure|Comedy'],
              ['2', 'Jumanji (1995)', 'Adventure|Family|Fantasy'],
            ],
          }
        : {
            headers: ['movieId', 'cast', 'crew'],
            data: [
              ['1', 'Tom Hanks, Tim Allen', 'John Lasseter'],
              ['2', 'Robin Williams, Kirsten Dunst', 'Joe Johnston'],
            ],
          };
      setCsvData(fallbackData);
    }
  };

  const handleNavClick = (section) => {
    setActiveSection(section);
    setSelectedCsv(null);
    setCsvData(null);
    setCsvError('');
  };

  const handleCsvClick = (filename) => {
    setSelectedCsv(filename);
    fetchCsvData(filename);
  };

  const renderSidePanel = () => {
    if (!activeSection && !selectedCsv) return null;

    if (selectedCsv && csvData) {
      return (
        <div className="side-panel">
          <h3>{selectedCsv}</h3>
          {csvError && <p className="error">{csvError}</p>}
          <table className="csv-table">
            <thead>
              <tr>
                {csvData.headers.map((header, index) => (
                  <th key={index}>{header}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {csvData.data.map((row, rowIndex) => (
                <tr key={rowIndex}>
                  {row.map((cell, cellIndex) => (
                    <td key={cellIndex}>{cell}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      );
    }

    if (activeSection === 'Data Collection') {
      return (
        <div className="side-panel">
          <h3>Data Collection</h3>
          <p>Click a file to view its contents:</p>
          <ul>
            <li>
              <a href="#" onClick={() => handleCsvClick('movies.csv')}>
                movies.csv
              </a>
            </li>
            <li>
              <a href="#" onClick={() => handleCsvClick('credits.csv')}>
                credits.csv
              </a>
            </li>
          </ul>
          {csvError && <p className="error">{csvError}</p>}
        </div>
      );
    }

    const sectionData = policy.find(item => item.section === activeSection);
    return (
      <div className="side-panel">
        <h3>{activeSection}</h3>
        <p>{sectionData ? sectionData.content : 'No details available.'}</p>
      </div>
    );
  };

  return (
    <div className="privacy">
      {/* <Header /> */}
      <nav className="privacy-nav">
        <a
          href="#"
          className={activeSection === 'Privacy Collection' ? 'active' : ''}
          onClick={() => handleNavClick('Privacy Collection')}
        >
          Privacy Collection
        </a>
        <a
          href="#"
          className={activeSection === 'Data Collection' ? 'active' : ''}
          onClick={() => handleNavClick('Data Collection')}
        >
          Data Collection
        </a>
        <a
          href="#"
          className={activeSection === 'Data Usage' ? 'active' : ''}
          onClick={() => handleNavClick('Data Usage')}
        >
          Data Usage
        </a>
      </nav>
      <main>
        <h1>Privacy Policy</h1>
        {error && <p className="error">{error}</p>}
        <div className="content">
          {policy.map((item, index) => (
            <div key={index}>
              <h3>{item.section}</h3>
              <p>{item.content}</p>
            </div>
          ))}
        </div>
      </main>
      {renderSidePanel()}
      <Footer />
    </div>
  );
}

export default Privacy;
